import React from 'react'
import Card from '../components/card'

class Home extends React.Component {

    componentDidMount () {
        const AllToons = fetch('https://rickandmortyapi.com/api/character/ ')

        AllToons.then(data => data.json())
    }

    render () {
        return (
            <div>
                <Card dataToSend={this.AllToons}></Card>
            </div>
        )
    }
}

export default Home;
